(def eulers-method (lmm-ode-solve y'
                                  [0 1]
                                  :x-max 1
                                  :h 1/8
                                  :method (fn [f h]
                                            (fn [[x y]]
                                              [(+ x h)
                                               (+ y (* h (f x y)))]))))
