;; @@
(defn eulers [f h]
  (fn [[x y]]
    [(+ x h)
     (+ y (* h (f x y)))]))

;; TODO
(defn trapezoidal-rule [f h]
  (fn [[x y]]
    (let [y1 (* h (f x y))
          y2 (* h (f x y))] ;; TODO
      [(+ x h)
       (+ y (* 1/2 (+ y1 y2)))])))

(defn simpsons-rule [f h]
  ;; TODO this one gives us y_n+2...
  (fn [[x y]]
    (let [y1 (* h (f x y))
          y2 (* h (f x y)) ;; TODO
          y3 (* h (f x y))]   ;; TODO
      [(+ x h)
       (+ y (* 1/3 (+ y1 y2 y3)))])))

(defn runge-kutta-4 [f h]
  (fn [[x y]]
    (let [y1 (* h (f x y))
          y2 (* h (f (+ x (/ h 2)) (+ y (/ y1 2))))
          y3 (* h (f (+ x (/ h 2)) (+ y (/ y2 2))))
          y4 (* h (f (+ x h) (+ y y1)))]
      [(+ x h)
       (+ y (* 1/6 (+ y1 (* 2 y2) (* 2 y3) y4)))])))
